/*Table structure for table `tbl_studentmembership` */

DROP TABLE IF EXISTS `tbl_studentmembership`;

CREATE TABLE `tbl_studentmembership` (
  `studmem_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) NOT NULL DEFAULT 0,
  `year` year(4) DEFAULT 2000,
  `membership_type` text DEFAULT NULL,
  `membership_price` varchar(255) DEFAULT NULL,
  `insurance` text DEFAULT NULL,
  `invoice_id` int(11) DEFAULT 0,
  `branch_id` int(11) DEFAULT NULL,
  `date_added` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`studmem_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentmembership` */

