/*Table structure for table `tbl_studentpackages` */

DROP TABLE IF EXISTS `tbl_studentpackages`;

CREATE TABLE `tbl_studentpackages` (
  `studpack_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT 0,
  `invoice_id` int(11) DEFAULT 0,
  `package_id` int(11) DEFAULT 0,
  `details` text DEFAULT NULL,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`studpack_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

