/*Table structure for table `tbl_students` */

DROP TABLE IF EXISTS `tbl_students`;

CREATE TABLE `tbl_students` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_id` varchar(255) NOT NULL DEFAULT '',
  `lastname` varchar(255) NOT NULL DEFAULT '',
  `firstname` varchar(255) NOT NULL DEFAULT '',
  `middlename` varchar(255) DEFAULT '',
  `extname` varchar(255) DEFAULT '',
  `nickname` varchar(255) DEFAULT '',
  `address` text DEFAULT NULL,
  `mobileno` varchar(255) DEFAULT NULL,
  `telephoneno` varchar(255) DEFAULT NULL,
  `emailadd` varchar(255) DEFAULT NULL,
  `birthdate` date NOT NULL,
  `religion` varchar(22) DEFAULT NULL,
  `sex` varchar(50) DEFAULT '',
  `height` int(50) DEFAULT NULL,
  `weight` int(50) DEFAULT NULL,
  `school` text DEFAULT NULL,
  `company` text DEFAULT NULL,
  `fatherinfo` text DEFAULT NULL,
  `motherinfo` text DEFAULT NULL,
  `guardianinfo` text DEFAULT NULL,
  `emergencyinfo` text DEFAULT NULL,
  `healthproblems` text DEFAULT NULL,
  `previoustrainings` text DEFAULT NULL,
  `archived` int(5) NOT NULL DEFAULT 0,
  `status` int(5) DEFAULT 0,
  `photo` blob DEFAULT NULL,
  `registration_date` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_students` */

